import React from 'react';

const DepartamentosModule = () => {
  return (
    <div style={{ padding: '1.5rem' }}>
      <h2 style={{ fontSize:'1.5rem', fontWeight:'bold' }}>Módulo de Departamentos</h2>
      <p>Gestión de departamentos, asignación de responsables y estructura organizativa.</p>
    </div>
  );
};

export default DepartamentosModule;
